// ProfessionalPage.js
import React from 'react';
import ProfessionalNavbar from '../ProfessionalNavbar';

const ProfessionalPage = ({ children }) => {
  return (
    <div>
      <ProfessionalNavbar />
      {children}
    </div>
  );
};

export default ProfessionalPage;
